import React from "react";
import { Card, Avatar } from "antd";

const UserProfile = () => {
  return (
    <>
      <Card
        actions={[
          <div key="twit">
            a<br />0
          </div>,
        ]}
      >
        <Card.Meta avatar={<Avatar>Hi</Avatar>} title="Hyoil"></Card.Meta>
      </Card>
    </>
  );
};

export default UserProfile;
